<strong><u>World Cup Qualifier South America</u></strong>
<p style="text-align: justify;">Colombia played a total of 18 games for their Qualifying round in South America with a total of 27 points on the table conceding 7 wins 6 draws and 5 losses. Colombia drew 1- 1 against Peru in the first round of World Cup qualifier and defeated 1-2 against Paraguay in the second round. In the third round, Colombia again drewÂ Â  1-1 against <a href="http://wikiceleb.com/brazil-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Brazil</a> and again in fourth round they consecutively drew 0-0 against Venezuela. Colombia earned six points after back to back victory over 0-2 over Ecuador and 1-0 against Bolivia. But in the seventh round, Colombia defeated 3-0 against rivalry nation <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a>. Colombia drew 0-0 against Chile and 2-2 against <a href="http://wikiceleb.com/uruguay-road-russia-world-cup-2018/" target="_blank" rel="noopener">Uruguay</a> in 8<sup>th</sup> and 9<sup>th</sup> round respectively. In 10<sup>th</sup> round Colombia win 0- over Paraguay and defeated 2-1 against <a href="http://wikiceleb.com/brazil-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Brazil</a> in the 11<sup>th</sup> round of World Cup qualifying. Then Colombia won back to back three matches 2-0 against Venezuela, 3-1 against Ecuador and 2-3 against Bolivia, in 12<sup>th</sup>, 13<sup>th</sup>, and 14<sup>th</sup> round of World Cup qualifying round respectively. Again Colombia loses 0-1 against <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a> in the 15<sup>th</sup> round and drew 1-1 against Chile in the 16<sup>th</sup> round. In the 17<sup>th</sup> round of World Cup qualifying Colombia loses 3-0 against <a href="http://wikiceleb.com/uruguay-road-russia-world-cup-2018/" target="_blank" rel="noopener">Uruguay</a> and at last round of World Cup qualifying match Colombian