<strong><u>World Cup Qualifier South America</u></strong>
<p style="text-align: justify;">Brazil played a total of 18 games for their qualifier in South America. Brazil managed to lead the qualifier table and the end of the last round leaving <a href="http://wikiceleb.com/uruguay-road-russia-world-cup-2018/" target="_blank" rel="noopener">Uruguay</a> and <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a> for a second and third place in the qualifier table. Brazil won 12 games with 5 draws and one loss during their qualifier round. Brazil defeated <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a> in the 11<sup>th</sup> round of the qualifier with the final score of 3-0 where Coutinho, Neymar and Paulinho managed to score for Brazil. On the very first round of the World Cup qualifier South America Brazil was defeated against Chile with the final Score of 2-0. Brazil Drew against <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a> in the third round of the competition they also drew against <a href="http://wikiceleb.com/uruguay-road-russia-world-cup-2018/" target="_blank" rel="noopener">Uruguay</a> in the fifth round. After 10<sup>th</sup> round of the competition, Brazil started leading the qualifier table and managed to qualify for the FIFA World Cup 2018.</p>
